function checkFiles(name, content){
    
    var file = new File(name);
    var content_here = "";
    
    if(file.exists){
        file.encoding = "BINARY";
        file.open("r");
        content_here = file.read();
        file.close();
        
        }else{
            var folder = new Folder(file.path);
            if(!folder.exists){
                folder.create();
                }
            }
        
   var success = content == content_here;
   if(!success){
       file.encoding = "BINARY";
       file.open("w");
       file.write(content);
       file.close();
       }
   
   return success;
    }


